try(jsonlite::toJSON(`correlation_387383a75076` %>% 
dplyr::ungroup() %>% 
dplyr::mutate(c1=DEP_DELAY,c2=ARR_DELAY,c3=CARRIER) %>% 
dplyr::select(c1,c2,c3) %>% 
dplyr::filter(!is.na(c1)) %>% 
group_by(c3) %>% 
(function(grouped.df) { 
  nsamples <- 5000
  sample.df <- grouped.df %>% ungroup() %>% (function(df) {if (nrow(df)>nsamples) {set.seed(1); return (sample_n(df, nsamples)); } else {return (df);}})
  sample.df <- sample.df %>% arrange(c3,c1) 
  critval=qnorm(0.975,0,1)
  model.df1 <- grouped.df %>% 
    filter(!is.na(c2),!is.na(c1)) %>% 
    nest() %>% 
    mutate(modeldf = purrr::map(data, function(x) {  
      tryCatch ( 
        { return (lm(c2~c1, data=x)) }, 
        error = function(e) { return (NA) }  
      )     
    }))  %>% 
    mutate(fitdata = purrr::map(data, function(x) data.frame(c1=  seq(min(x$c1, na.rm=TRUE),max(x$c1, na.rm=TRUE), length.out=20) ))) %>% 
    mutate(fitdata = purrr::map2(modeldf, fitdata, function(x,y) {
      if (is.na(x)) {
        return (NA)
      } else {
        tryCatch(
          { return (broom::augment(x, newdata=y) %>% mutate(conf_low = .fitted - critval*.se.fit, conf_high = .fitted + critval*.se.fit, .resp="c2") %>% rename(predicted_value=.fitted))}, 
          error = function(e) { return (NA) }
        )
      }
    })) %>% 
    select(-modeldf, -data) 

  return (list( bind_rows(model.df1), sample.df))  
})
, na="null" ))
